import http from "./httpService";
const endpoint = "user";

export const login = async (username, password) =>
  await http.post(`${endpoint}/login`, {
    username,
    password,
  });

export const getUserInfo = async () => http.get(`${endpoint}/`);

export const getUserList = async () => http.get(`${endpoint}/get_users`);

export const registerStudent = async ({
  username,
  password,
  name,
  birthday,
  gender,
  race,
  religion,
  address,
  telNo: tel_no,
  hpNo: hp_no,
  email,
  schoolId: school_id,
  disability,
}) =>
  http.post(`${endpoint}/register_student`, {
    username,
    password,
    userType,
    name,
    birthday,
    gender,
    race,
    religion,
    address,
    tel_no,
    hp_no,
    email,
    school_id,
    disability,
  });

export const registerTeacher = async () =>
  http.post(`${endpoint}/register_teacher`);
